INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `head_seo_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawa', '', 'nasze zasady i warunki dostawy', 'conditions, delivery, delay, shipment, pack', '<h2>Wysyłki i zwroty</h2>\n<p style=\"font-size:11px;font-weight:400;\"><strong>Twoja paczka</strong><br /><br />Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i są wysyłane za pośrednictwem firmy UPS ze śledzeniem i nadawaniem bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego przed wybraniem tej metody skontaktuj się z nami. Bez względu na to, jakiego rodzaju przesyłki wybierzesz, otrzymasz od nas link do śledzenia przesyłki online.<br /><br />Opłaty za wysyłkę obejmują opłaty manipulacyjne i koszty pakowania, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty transportowe różnią się w zależności od całkowitej wagi przesyłki. Zalecamy zgrupowanie artykułów w jednym zamówieniu. Nie możemy zgrupować dwóch odrębnych zamówień złożonych oddzielnie, a opłaty za wysyłkę będą naliczane dla każdego z nich. Paczka zostanie wysłana na własne ryzyko, ale należy zachować szczególną ostrożność w celu ochrony delikatnych przedmiotów.<br /><br />Pudełka są pokaźnych rozmiarów, a Twoje przedmioty są dobrze chronione.</p>', 'dostawa'),
(3, 1, 1, 'Regulamin użytkowania', '', 'Nasze warunki użytkowania', 'conditions, terms, use, sell', '<h2>Twoje warunki użytkowania</h2>', 'regulamin-uzytkowania'),
(4, 1, 1, 'O nas', '', 'Dowiedz sie więcej o nas', 'about us, informations', '<h2><span style=\"font-size:11px;font-weight:400;\">O nas</span><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Nasza firma</span><br style=\"font-size:11px;font-weight:400;\" /><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Nasza firma</span><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Nasz zespół</span><br style=\"font-size:11px;font-weight:400;\" /><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Nasz zespół</span><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Informacje</span><br style=\"font-size:11px;font-weight:400;\" /><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Informacje</span></h2>', 'o-nas'),
(5, 1, 1, 'Bezpieczna płatność', '', 'Nasz bezpieczny sposób płatności', 'secure payment, ssl, visa, mastercard, paypal', '<h2><span style=\"font-size:11px;font-weight:400;\">Bezpieczna płatność</span><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Nasza bezpieczna płatność</span><br style=\"font-size:11px;font-weight:400;\" /><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Z SSL</span><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">Korzystanie z karty Visa/Mastercard/Paypal</span><br style=\"font-size:11px;font-weight:400;\" /><br style=\"font-size:11px;font-weight:400;\" /><span style=\"font-size:11px;font-weight:400;\">O tych usługach</span></h2>', 'bezpieczna-platnosc');
