INSERT INTO `ps_info_lang` (`id_info`, `id_shop`, `id_lang`, `text`) VALUES
(1, 1, 1, '<h2 class=\"h2\" style=\"margin-top:0px;margin-bottom:0.5rem;font-family:inherit;font-weight:500;line-height:1.1;color:#232323;font-size:1.5rem;text-transform:uppercase;text-align:center;\"><strong style=\"font-weight:bolder;\">NAJWYŻSZEJ JAKOŚCI LAMPY I OŚWIETLENIE - 50.000 PRODUKTÓW - TYLKO NA<span> </span><span class=\"light\">LAMPYSHOP</span></strong></h2>\n\n<div class=\"container\" style=\"margin-left:auto;margin-right:auto;padding-left:15px;padding-right:15px;width:1140px;max-width:100%;\">\n<div id=\"content-wrapper\" class=\"js-content-wrapper\">\n\n\n<div id=\"custom-text\" style=\"padding:3.125rem;margin-bottom:1.5rem;text-align:center;background:#ffffff;\">\n<div class=\"row\" style=\"margin-right:-15px;margin-left:-15px;text-align:left;\">\n<div class=\"col-sm-10\" style=\"min-height:1px;padding-right:15px;padding-left:15px;float:left;width:866.664px;\">\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.875rem;\"></p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.875rem;\">Sklep Lampy.pl oferuje szeroki wybór lamp, oświetlenia dekoracyjnego i źródeł światła.</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.875rem;\">Planują Państwo budowę domu, remont mieszkania, a może mają Państwo jedynie ochotę na zmiany? W naszym sklepie znajdziecie Państwo odpowiednie lampy i oświetlenie do każdego wnętrza</p>\n<p style=\"margin-top:0px;margin-bottom:1rem;font-size:0.875rem;\">Odpowiednio dobrane światło podnosi jakość życia – dzięki odpowiednim lampom będą się Państwo lepiej czuć we własnych czterech ścianach. Światło tworzy piękną atmosferę – do dobrego samopoczucia, odprężenia i pracy. Właściwie wybrana lampa nada pomieszczeniu charakteru i stworzy w nim niepowtarzalny klimat. Dobrze dobrane żarówki chronią oczy przed szybkim zmęczeniem oraz podnoszą komfort. Z lampami ze sklepu internetowego Lampy.pl urządzą Państwo własne mieszkanie nastrojowo i pomysłowo.</p>\n</div>\n</div>\n</div>\n\n\n</div>\n</div>\n');
